/*
REQUIREMENTS_BEGIN
{
    "chart_type": "Horizontal Bar Chart",
    "chart_name": "horizontal_bar_chart_03",
    "is_composite": false,
    "required_fields": ["x", "y"],
    "required_fields_type": [["categorical"], ["numerical"]],
    "required_fields_range": [[2, 30], [0, "inf"]],
    "required_fields_icons": ["x"],
    "required_other_icons": [],
    "required_fields_colors": [],
    "required_other_colors": ["primary"],
    "supported_effects": ["shadow", "radius_corner", "gradient", "stroke", "spacing"],
    "min_height": 400,
    "min_width": 400,
    "background": "styled",
    "icon_mark": "none",
    "icon_label": "side",
    "has_x_axis": "no",
    "has_y_axis": "no"
}
REQUIREMENTS_END
*/

// 水平条形图实现 - 使用D3.js
function makeChart(containerSelector, data) {
    // ---------- 1. 数据准备阶段 ----------
    
    // 提取数据和配置
    const jsonData = data;                           // 完整的JSON数据对象
    const chartData = jsonData.data.data                 // 实际数据点数组  
    const variables = jsonData.variables || {};      // 图表配置
    const typography = jsonData.typography || {      // 字体设置，如果不存在则使用默认值
        title: { font_family: "Arial", font_size: "18px", font_weight: "bold" },
        label: { font_family: "Arial", font_size: "12px", font_weight: "normal" },
        description: { font_family: "Arial", font_size: "14px", font_weight: "normal" },
        annotation: { font_family: "Arial", font_size: "12px", font_weight: "normal" }
    };
    const colors = jsonData.colors || { text_color: "#333333" };  // 颜色设置
    const images = jsonData.images || { field: {}, other: {} };   // 图像设置
    const dataColumns = jsonData.data.columns || []; // 数据列定义
    
    // 设置视觉效果变量的默认值
    variables.has_rounded_corners = true; // 默认启用圆角，匹配图片中的样式
    variables.has_shadow = variables.has_shadow || false;
    variables.has_gradient = variables.has_gradient || false;
    variables.has_stroke = variables.has_stroke || false;
    variables.has_spacing = variables.has_spacing || false;
    
    // 清空容器
    d3.select(containerSelector).html("");
    
    // ---------- 2. 尺寸和布局设置 ----------
    
    // 设置图表总尺寸
    const width = variables.width || 800;
    const height = variables.height || 600;
    
    // 设置初始边距，稍后会根据文本宽度调整
    const margin = {
        top: 60,      // 顶部留出标题空间
        right: 80,    // 右侧足够显示数值标签
        bottom: 30,   // 底部边距
        left: 20      // 初始左侧边距，将在计算文本宽度后调整
    };
    
    // ---------- 3. 提取字段名和单位 ----------
    
    // 根据数据列顺序提取字段名
    const dimensionField = dataColumns.find(col => col.role === "x").name;
    const valueField = dataColumns.find(col => col.role === "y").name;
    
    // 获取字段单位（如果存在）
    let dimensionUnit = "";
    let valueUnit = ""; // 默认为百分比
    
    if (dataColumns.find(col => col.role === "x").unit !== "none") {
        dimensionUnit = dataColumns.find(col => col.role === "x").unit;
    }
    
    if (dataColumns.find(col => col.role === "y").unit !== "none") {
        valueUnit = dataColumns.find(col => col.role === "y").unit;
    }
    
    // ---------- 4. 数据处理 ----------
    
    // 获取唯一维度值并按数值降序排列数据
    const dimensions = [...new Set(chartData.map(d => d[dimensionField]))];
    
    // 按数值降序排序数据
    const sortedData = [...chartData].sort((a, b) => b[valueField] - a[valueField]);
    const sortedDimensions = sortedData.map(d => d[dimensionField]);
    
    // ---------- 5. 计算标签宽度和布局 ----------
    
    // 创建临时SVG来测量文本宽度
    const tempSvg = d3.select(containerSelector)
        .append("svg")
        .attr("width", 0)
        .attr("height", 0)
        .style("visibility", "hidden");
    
    // 图标尺寸和间距参数
    const flagWidth = 24;
    const flagHeight = 18;
    const textPadding = 10;       // 文本左侧的内边距
    const textIconGap = 5;        // 文本右边缘与图标左边缘之间的小间距
    const flagBarGap = 10;        // 图标和条形图之间的间距
    const barValueGap = 10;       // 条形图和数值标签之间的间距
    
    // 计算最大维度标签宽度
    let maxLabelWidth = 0;
    dimensions.forEach(dimension => {
        // 格式化维度名称（附加单位，如果有）
        const formattedDimension = dimensionUnit ? 
            `${dimension}${dimensionUnit}` : 
            `${dimension}`;
            
        const tempText = tempSvg.append("text")
            .style("font-family", typography.label.font_family)
            .style("font-size", typography.label.font_size)
            .style("font-weight", typography.label.font_weight)
            .text(formattedDimension);
        
        const textWidth = tempText.node().getBBox().width;
        maxLabelWidth = Math.max(maxLabelWidth, textWidth);
        
        tempText.remove();
    });
    
    // 计算最大数值标签宽度
    let maxValueWidth = 0;
    chartData.forEach(d => {
        const formattedValue = valueUnit ? 
            `${d[valueField]}${valueUnit}` : 
            `${d[valueField]}`;
            
        const tempText = tempSvg.append("text")
            .style("font-family", typography.annotation.font_family)
            .style("font-size", typography.annotation.font_size)
            .style("font-weight", typography.annotation.font_weight)
            .text(formattedValue);
        
        const textWidth = tempText.node().getBBox().width;
        maxValueWidth = Math.max(maxValueWidth, textWidth);
        
        tempText.remove();
    });
    
    // 删除临时SVG
    tempSvg.remove();
    
    // 根据标签宽度调整左边距，为各元素预留足够空间
    // 由于文本是右对齐且与图标有小间距，所以左边距计算为文本最大宽度 + 文本图标间距 + 图标宽度 + 图标和条形图间距
    const requiredLeftMargin = maxLabelWidth + textIconGap + flagWidth + flagBarGap;
    margin.left = Math.max(margin.left, requiredLeftMargin);
    
    // 调整右边距以适应数值标签
    margin.right = Math.max(margin.right, maxValueWidth + barValueGap);
    
    // 计算内部绘图区域尺寸
    const innerWidth = width - margin.left - margin.right;
    const innerHeight = height - margin.top - margin.bottom;
    
    // ---------- 6. 创建SVG容器 ----------
    
    const svg = d3.select(containerSelector)
        .append("svg")
        .attr("width", "100%")
        .attr("height", height)
        .attr("viewBox", `0 0 ${width} ${height}`)
        .attr("style", "max-width: 100%; height: auto;")
        .attr("xmlns", "http://www.w3.org/2000/svg")
        .attr("xmlns:xlink", "http://www.w3.org/1999/xlink");
    
    // 添加defs用于视觉效果
    const defs = svg.append("defs");
    
    // 添加阴影滤镜（如果启用）
    if (variables.has_shadow) {
        const filter = defs.append("filter")
            .attr("id", "shadow")
            .attr("filterUnits", "userSpaceOnUse")
            .attr("width", "200%")
            .attr("height", "200%");
        
        filter.append("feGaussianBlur")
            .attr("in", "SourceAlpha")
            .attr("stdDeviation", 3);
        
        filter.append("feOffset")
            .attr("dx", 2)
            .attr("dy", 2)
            .attr("result", "offsetblur");
        
        const feMerge = filter.append("feMerge");
        feMerge.append("feMergeNode");
        feMerge.append("feMergeNode").attr("in", "SourceGraphic");
    }
    
    // 添加中心渐变（两边暗，中间亮）- 强制为所有bar应用
    const primaryColor = colors.other && colors.other.primary ? colors.other.primary : "#C0985A"; // 金褐色作为默认值
    
    const gradient = defs.append("linearGradient")
        .attr("id", "bar-gradient")
        .attr("x1", "0%")
        .attr("y1", "0%")
        .attr("x2", "100%")
        .attr("y2", "0%");
    
    // 定义从左到右的渐变，中间最亮，两边较暗
    gradient.append("stop")
        .attr("offset", "0%")
        .attr("stop-color", d3.rgb(primaryColor).darker(0.3));
    
    gradient.append("stop")
        .attr("offset", "50%")
        .attr("stop-color", d3.rgb(primaryColor).brighter(2.5));
    
    gradient.append("stop")
        .attr("offset", "100%")
        .attr("stop-color", d3.rgb(primaryColor).darker(0.3));
    
    // ---------- 7. 创建比例尺 ----------
    
    // 计算条形的额外间距（如果启用）
    const barPadding = variables.has_spacing ? 0.3 : 0.2;
    
    // Y轴比例尺（用于维度）
    const yScale = d3.scaleBand()
        .domain(sortedDimensions)
        .range([0, innerHeight])
        .padding(barPadding);
    
    // X轴比例尺（用于数值）
    const xScale = d3.scaleLinear()
        .domain([0, d3.max(chartData, d => +d[valueField]) * 1.05]) // 添加5%边距
        .range([0, innerWidth]);
    
    // ---------- 8. 创建主图表组 ----------
    
    const g = svg.append("g")
        .attr("transform", `translate(${margin.left}, ${margin.top})`);
    
    // ---------- 9. 计算元素位置 ----------
    
    // 图标的起始 X 位置 (在条形图左侧)
    const flagX = -flagBarGap - flagWidth;
    
    // 文本标签的 X 位置 (右对齐，右边缘与图标保持小间距)
    const textX = flagX - textIconGap; // 文本右对齐，X位置设为图标左边缘减去小间距
    
    // 条形图的起始 X 位置 (在图标右侧，此处为坐标系原点)
    const barX = 0;
    
    // ---------- 10. 绘制条形和标签 ----------
    
    // 设置主色，用于生成渐变和描边
    const getPrimaryColor = () => {
        // 根据用户提供的图片，使用金褐色作为默认值
        return colors.other && colors.other.primary ? colors.other.primary : "#C0985A";
    };
    
    // 获取描边颜色（使用主色的更暗版本）
    const getStrokeColor = () => {
        const primaryColor = getPrimaryColor();
        // 使用比填充色更暗的颜色作为描边
        return d3.rgb(primaryColor).darker(0.4);
    };
    
    // 添加交替行背景
    if (jsonData.variation?.background === "styled" || true) { // 默认启用交替行背景
        sortedDimensions.forEach((dimension, i) => {
            if (i % 2 === 0) {
                g.append("rect")
                    .attr("x", -margin.left)
                    .attr("y", yScale(dimension))
                    .attr("width", innerWidth + margin.left + margin.right)
                    .attr("height", yScale.bandwidth())
                    .attr("class", "background")
                    .attr("fill", "#f5f5f5")
                    .attr("opacity", 1); 
            }
        });
    }
    
    // 添加四角星函数 - 用于第一个条形图
    function addStarsToFirstBar(g, dimension, barWidth, barHeight, centerY) {
        // 只为第一个维度添加星星（排序后的第一个维度即销量最高的）
        if (dimension === sortedDimensions[0]) {
            // 星星尺寸
            const starWidth = 40;
            const starHeight = 40;
            
            // 星星位置 - 基于条形图末端
            const xPos = barWidth*0.8; // 条形图末端位置
            
            // 星星的base64编码 - 替换为您的实际base64编码
            // 这里使用示例base64编码，您需要替换为自己的四角星图片
            const starBase64 = "data:image/svg+xml;base64,"
            // 添加三颗星
            const starPositions = [
                {x: xPos + 15, y: centerY - 20}, // 左上
                {x: xPos - 5 , y: centerY}, // 中间
                {x: xPos + 15, y: centerY + 20} // 左下
            ];
            
            starPositions.forEach(pos => {
                g.append("image")
                    .attr("x", pos.x)
                    .attr("y", pos.y - starHeight/2) // 垂直居中
                    .attr("width", starWidth)
                    .attr("height", starHeight)
                    .attr("preserveAspectRatio","xMidYMid meet")
                    .attr("xlink:href", starBase64);
            });
        }
    }
    
    // 为每个维度绘制条形和标签
    sortedDimensions.forEach(dimension => {
        const dataPoint = chartData.find(d => d[dimensionField] === dimension);
        
        if (dataPoint) {
            const barHeight = yScale.bandwidth();
            const barWidth = xScale(+dataPoint[valueField]);
            const centerY = yScale(dimension) + barHeight / 2;
            
            // 1. 添加维度文本标签 (右对齐，紧挨图标)
            g.append("text")
                .attr("x", textX)
                .attr("y", centerY)
                .attr("dy", "0.35em")
                .attr("text-anchor", "end") // 改为右对齐
                .style("font-family", typography.label.font_family)
                .style("font-size", typography.label.font_size)
                .style("font-weight", typography.label.font_weight)
                .style("fill", colors.text_color || "#333333")
                .text(dimension);
            
            // 2. 添加图标 (在文本右侧)
            if (images.field && images.field[dimension]) {
                g.append("image")
                    .attr("x", flagX)
                    .attr("y", centerY - flagHeight / 2)
                    .attr("width", flagWidth)
                    .attr("height", flagHeight)
                    .attr("preserveAspectRatio","xMidYMid meet") // 确保图标不失真
                    .attr("xlink:href", images.field[dimension]);
            }
            
            // 3. 绘制条形 (在图标右侧)
            g.append("rect")
                .attr("x", barX)
                .attr("y", yScale(dimension))
                .attr("width", barWidth)
                .attr("height", barHeight)
                .attr("fill", "url(#bar-gradient)") // 强制使用渐变
                .attr("rx", barHeight/3) // 较大的圆角半径，确保两端都是圆形
                .attr("ry", barHeight/3)
                .style("stroke", getStrokeColor()) // 强制使用描边
                .style("stroke-width", 1) // 设置描边宽度
                .style("filter", variables.has_shadow ? "url(#shadow)" : "none")
                .on("mouseover", function() {
                    d3.select(this).attr("opacity", 0.8);
                })
                .on("mouseout", function() {
                    d3.select(this).attr("opacity", 1);
                });
            
            // 新增: 为第一个条形添加星星
            addStarsToFirstBar(g, dimension, barWidth, barHeight, centerY);
            
            // 4. 添加数值标签 (在条形右侧)
            const formattedValue = valueUnit ? 
                `${dataPoint[valueField]}${valueUnit}` : 
                `${dataPoint[valueField]}`;
            
            g.append("text")
                .attr("x", barWidth + barValueGap)
                .attr("y", centerY)
                .attr("dy", "0.35em")
                .attr("text-anchor", "start")
                .style("font-family", typography.annotation.font_family)
                .style("font-size", `${Math.min(20,Math.max(barHeight * 0.6, parseFloat(typography.annotation.font_size)))}px`)
                .style("font-weight", typography.annotation.font_weight)
                .style("fill", colors.text_color || "#333333")
                .text(formattedValue);
        }
    });
    
    // 返回SVG节点
    return svg.node();
}